import React, { useState } from 'react'
import { useQuery } from 'react-query'
const fetchData = async () => await (await fetch('https://bing.com/covid/data')).json()

function HomePage() {
    const data = async () => await (await fetch('https://bing.com/covid/data')).json()

    if (data) return <div>{JSON.stringify(data)}</div>
}

export default HomePage
